      const timer = setInterval(() => {
        if (currentIndex < originalText.length) {
          setText(originalText.slice(0, currentIndex + 1));
          currentIndex++;
        } else {
          clearInterval(timer);
        }
      }, typingSpeed);

      return () => {
        clearInterval(timer);
      };
    }, []);

    return (
      <div>
        <p>{text}</p>
        <CursorBlink />
